import React from "react";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav>
      <ul>
        <Link to="/about">
          <li>About</li>
        </Link>
        <Link to="/home">
          <li>Home</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
